import React, { useState } from 'react';
import { Tabs, Tab } from '@mui/material';
import FATCAUpload from './FATCAUpload';
import FATCAReport from './FATCAReport';
import FATCAImageUpload from './FATCAImageUpload';

const FATCATabs = () => {
    const [selectedTab, setSelectedTab] = useState(0);

    const handleChange = (event, newValue) => {
        setSelectedTab(newValue);
    };

    return (
        <div>
            <Tabs value={selectedTab} onChange={handleChange}>
                <Tab label="FATCA Upload" />
                <Tab label="FATCA Report" />
                <Tab label="FATCA Image Upload" />
            </Tabs>
            {selectedTab === 0 && <FATCAUpload />}
            {selectedTab === 1 && <FATCAReport />}
            {selectedTab === 2 && <FATCAImageUpload />}
        </div>
    );
};

export default FATCATabs;
